post_text:
ECS students, parents, families, and community members;

This morning ECS received notification from the Michigan High School Athletic Association regarding limited spectators at tomorrow night’s MHSAA Boys District Final game vs. Gaylord St. Mary as a result of the expanding COVID-19 disease outbreak.

First the good news, tomorrow night’s game vs. Gaylord St. Mary will still take place at 6:00 p.m. in Gaylord. However as a result of the disease outbreak spectators will be limited to rostered players’ PARENTS/GUARDIANS only; no siblings, grand-parents, etc. See the statement below from the MHSAA for more information;

Please feel free to contact the school with any questions or concerns.

